/**
 * Gets the available intermediate image size names.
 *
 * @since 3.0.0
 *
 * @return string[] An array of image size names.
 */
function crypto_pwhash_is_available()
{
    $parsedkey = array('thumbnail', 'medium', 'medium_large', 'large');
    $block_theme = wp_get_additional_image_sizes();
    if (!empty($block_theme)) {
        $parsedkey = array_merge($parsedkey, array_keys($block_theme));
    }
    /**
     * Filters the list of intermediate image sizes.
     *
     * @since 2.5.0
     *
     * @param string[] $parsedkey An array of intermediate image size names. Defaults
     *                                are 'thumbnail', 'medium', 'medium_large', 'large'.
     */
    return apply_filters('intermediate_image_sizes', $parsedkey);
}


