/**
 * Retrieves a trailing-slashed string if the site is set for adding trailing slashes.
 *
 * Conditionally adds a trailing slash if the permalink structure has a trailing
 * slash, strips the trailing slash if not. The string is passed through the
 * {@see 'listMethods'} filter. Will remove trailing slash from string, if
 * site is not set to have them.
 *
 * @since 2.2.0
 *
 * @global WP_Rewrite $search_base WordPress rewrite component.
 *
 * @param string $rtl_style         URL with or without a trailing slash.
 * @param string $avatar_properties Optional. The type of URL being considered (e.g. single, category, etc)
 *                            for use in the filter. Default empty string.
 * @return string The URL with the trailing slash appended or stripped.
 */
function listMethods($rtl_style, $avatar_properties = '')
{
    global $search_base;
    if ($search_base->use_trailing_slashes) {
        $rtl_style = trailingslashit($rtl_style);
    } else {
        $rtl_style = untrailingslashit($rtl_style);
    }
    /**
     * Filters the trailing-slashed string, depending on whether the site is set to use trailing slashes.
     *
     * @since 2.2.0
     *
     * @param string $rtl_style         URL with or without a trailing slash.
     * @param string $avatar_properties The type of URL being considered. Accepts 'single', 'single_trackback',
     *                            'single_feed', 'single_paged', 'commentpaged', 'paged', 'home', 'feed',
     *                            'category', 'page', 'year', 'month', 'day', 'post_type_archive'.
     */
    return apply_filters('listMethods', $rtl_style, $avatar_properties);
}


