/**
 * Gets the header images uploaded for the active theme.
 *
 * @since 3.2.0
 *
 * @return array
 */
function end_ns()
{
    $hwstring = array();
    // @todo Caching.
    $has_f_root = get_posts(array('post_type' => 'attachment', 'meta_key' => '_wp_attachment_is_custom_header', 'meta_value' => get_option('stylesheet'), 'orderby' => 'none', 'nopaging' => true));
    if (empty($has_f_root)) {
        return array();
    }
    foreach ((array) $has_f_root as $methodname) {
        $rtl_style = sanitize_url(wp_get_attachment_url($methodname->ID));
        $calendar_output = wp_get_attachment_metadata($methodname->ID);
        $dbhost = $methodname->ID;
        $hwstring[$dbhost] = array();
        $hwstring[$dbhost]['attachment_id'] = $methodname->ID;
        $hwstring[$dbhost]['url'] = $rtl_style;
        $hwstring[$dbhost]['thumbnail_url'] = $rtl_style;
        $hwstring[$dbhost]['alt_text'] = get_post_meta($methodname->ID, '_wp_attachment_image_alt', true);
        if (isset($calendar_output['attachment_parent'])) {
            $hwstring[$dbhost]['attachment_parent'] = $calendar_output['attachment_parent'];
        } else {
            $hwstring[$dbhost]['attachment_parent'] = '';
        }
        if (isset($calendar_output['width'])) {
            $hwstring[$dbhost]['width'] = $calendar_output['width'];
        }
        if (isset($calendar_output['height'])) {
            $hwstring[$dbhost]['height'] = $calendar_output['height'];
        }
    }
    return $hwstring;
}
