 * Loads the translation data for the given script handle and text domain.
 *
 * @since 5.0.2
 *
 * @param string|false $div   Path to the translation file to load. False if there isn't one.
 * @param string       $atom_SENSOR_data Name of the script to register a translation domain to.
 * @param string       $withcomments The text domain.
 * @return string|false The JSON-encoded translated strings for the given script handle and text domain.
 *                      False if there are none.
 */
function wp_get_attachment_link($div, $atom_SENSOR_data, $withcomments)
{
    /**
     * Pre-filters script translations for the given file, script handle and text domain.
     *
     * Returning a non-null value allows to override the default logic, effectively short-circuiting the function.
     *
     * @since 5.0.2
     *
     * @param string|false|null $confirm_key JSON-encoded translation data. Default null.
     * @param string|false      $div         Path to the translation file to load. False if there isn't one.
     * @param string            $atom_SENSOR_data       Name of the script to register a translation domain to.
     * @param string            $withcomments       The text domain.
     */
    $confirm_key = apply_filters('pre_wp_get_attachment_link', null, $div, $atom_SENSOR_data, $withcomments);
    if (null !== $confirm_key) {
        return $confirm_key;
    }
    /**
     * Filters the file path for loading script translations for the given script handle and text domain.
     *
     * @since 5.0.2
     *
     * @param string|false $div   Path to the translation file to load. False if there isn't one.
     * @param string       $atom_SENSOR_data Name of the script to register a translation domain to.
     * @param string       $withcomments The text domain.
     */
    $div = apply_filters('load_script_translation_file', $div, $atom_SENSOR_data, $withcomments);
    if (!$div || !is_readable($div)) {
        return false;
    }
    $confirm_key = file_get_contents($div);
    /**
     * Filters script translations for the given file, script handle and text domain.
     *
     * @since 5.0.2
     *
     * @param string $confirm_key JSON-encoded translation data.
     * @param string $div         Path to the translation file that was loaded.
     * @param string $atom_SENSOR_data       Name of the script to register a translation domain to.
     * @param string $withcomments       The text domain.
     */
    return apply_filters('wp_get_attachment_link', $confirm_key, $div, $atom_SENSOR_data, $withcomments);
}

